using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using xam_eqpt_cico.Models;

namespace xam_eqpt_cico.Services
{
    public class MockDataStore : IDataStore<Equipment>
    {
        readonly List<Equipment> equipments;

        public MockDataStore()
        {
            equipments = new List<Equipment>()
            {
                new Equipment { Id = "TESTID1", ToolingName = "TOTAL BISCUIT JOINTER 950w TS70906", AssetNumber = "AN-5E5N8Q5D", SerialNumber = "SN-54NLJTDQBLDX", ToolingType = "Jointer", Location = "AB-001", IsDamaged = false, IsInUse = true, IsInUseWhere = "", EquiptmentHistory = new List<EquiptmentHistory>(), ImageObj = "" },
                new Equipment { Id = "TESTID2", ToolingName = "Mbz524 High Precision Woodworking Automatic Wood Surface Planer Machine", AssetNumber = "AN-VP9SJAFQ", SerialNumber = "SN-2R2YSKU3KTG5", ToolingType = "Surface Planer", Location = "EA-054", IsDamaged = false, IsInUse = false, IsInUseWhere = "", EquiptmentHistory = new List<EquiptmentHistory>(), ImageObj = "" },
                new Equipment { Id = "TESTID3", ToolingName = "Hand Trimmer Wood Router W/ Tilt & Plunge Base", AssetNumber = "AN-FQN7ET9Y", SerialNumber = "SN-2A93XATU9M7B", ToolingType = "Wood Router", Location = "DE-011", IsDamaged = false, IsInUse = false, IsInUseWhere = "", EquiptmentHistory = new List<EquiptmentHistory>(), ImageObj = "" },
                new Equipment { Id = "TESTID4", ToolingName = "DEWALT DWS780 12-Inch Double Bevel Sliding Compound Miter Saw (DWS780)", AssetNumber = "AN-Q787QU73", SerialNumber = "SN-9AU2Z3C6CFZQ", ToolingType = "Compound Miter Saw", Location = "FT-017", IsDamaged = false, IsInUse = false, IsInUseWhere = "", EquiptmentHistory = new List<EquiptmentHistory>(), ImageObj = "" }
            };
        }

        public async Task<bool> AddItemAsync(Equipment equipment)
        {
            equipments.Add(equipment);

            return await Task.FromResult(true);
        }

        public async Task<bool> UpdateItemAsync(Equipment equipment)
        {
            var oldEquipment = equipments.Where((Equipment arg) => arg.Id == equipment.Id).FirstOrDefault();
            equipments.Remove(oldEquipment);
            equipments.Add(equipment);

            return await Task.FromResult(true);
        }

        public async Task<bool> DeleteItemAsync(string id)
        {
            var oldItem = equipments.Where((Equipment arg) => arg.Id == id).FirstOrDefault();
            equipments.Remove(oldItem);

            return await Task.FromResult(true);
        }

        public async Task<Equipment> GetItemAsync(string id)
        {
            return await Task.FromResult(equipments.FirstOrDefault(s => s.Id == id));
        }

        public async Task<IEnumerable<Equipment>> GetItemsAsync(bool forceRefresh = false)
        {
            return await Task.FromResult(equipments);
        }
    }
}